'use strict';
//@@DocInclude
//@@DocBrief("The class provides info for an order request")
class OrderRequest {
    accountId;
    offerId;
    amount;
    buysell;
    timeInForce;
    expirationDate;
    customId;
    constructor() {
        this.accountId = "";
        this.offerId = "";
        this.amount = 0;
        this.buysell = "";
        this.timeInForce = "IOC";
        this.customId = "";
    }
    getAccountId() {
        return this.accountId;
    }
    getOfferId() {
        return this.offerId;
    }
    getAmount() {
        return this.amount;
    }
    getBuySell() {
        return this.buysell;
    }
    getTimeInForce() {
        return this.timeInForce;
    }
    getExpirationDate() {
        return this.expirationDate;
    }
    getCustomId() {
        return this.customId;
    }
}
module.exports = OrderRequest
